import React from 'react' ;



function Navbar(props) {
  return(

    <div>
   <nav>
    <div class="nav-wrapper">
  <a href="#!" class="brand-logo">{ props.brandname}</a>
      <a href="#" data-target="mobile-demo" class="sidenav-trigger"><i class="material-icons">menu</i></a>
      <ul class="right hide-on-med-and-down">
        <li><a href="sass.html">Sass</a></li>
        <li><a href="badges.html">Components</a></li>
        <li><a href="collapsible.html">Javascript</a></li>
        <li><a href="mobile.html">Mobile</a></li>
      </ul>
    </div>
  </nav>

  <ul class="sidenav" id="mobile-demo">
    <li><a href="sass.html">Sass</a></li>
    <li><a href="badges.html">Components</a></li>
    <li><a href="collapsible.html">Javascript</a></li>
    <li><a href="mobile.html">Mobile</a></li>
  </ul>
          

  </div>

  );
}


export function CustomFooter(props){
  return(
   <footer classNameName="page-footer font-small blue center-align">
       <div classNameName="footer-copyright text-center py-3">Â© 2020 Copyright:
  <a href="https://mdbootstrap.com/"> {props.brandname}</a>
        
      </div>
    </footer>
    

  );
}

export default Navbar ;
